import React from "react";

function App() {
  return (
    <div className="App flex w-4/5 h-screen m-auto">
      <div className="basis-2/3 my-auto ">
        <h1 className="text-8xl font-extralight">Welcome.</h1>
        <p className="font-light p-5">
          Here’s a shorter description that includes React Native apps: About Me
          I’m a final-year Computer Science student and web developer
          specializing in responsive web applications and React Native apps. I
          love creating user-friendly solutions with HTML, CSS, JavaScript, and
          modern frameworks. Check out my projects and feel free to get in
          touch!
        </p>
      </div>
      <div className="my-auto text-2xl ">Projects</div>
    </div>
  );
}

export default App;
